Hot Tamale (2006) 	




Verenigde Staten
Actie / Komedie
98 minuten

geregisseerd door Michael Damian
met Randy Spelling, Diora Baird en Carmen Electra

Harlan Woodriff (Randy Spelling) is het zat om bij z'n opa en moeder te wonen en dus besluit hij om naar LA te gaan. Wanneer hij daar is aangekomen ontmoet hij de sexy Tuesday (Diora Baird) maar door die ontmoeting komt hij in aanraking met vreemde personen zoals: juwelendieven, opwindende vrouwen en een gestoorde man die hem dood wil hebben.

English

Storyline

A road trip to Los Angeles inadvertently leads a young man from Wyoming into a wild maze of psychotic hit-men, racy women, jewel thieves and a salsa band.




